import React, { useState, useEffect } from "react";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import io from "socket.io-client";
import L from "leaflet";
import "leaflet/dist/leaflet.css";

// Importing marker images for different drone statuses
import redMarker from "./assets/red_marker.png";
import greenMarker from "./assets/green_marker.png";

const DroneMap = () => {
  const [droneData, setDroneData] = useState([]);
  const [avgVelocity, setAvgVelocity] = useState(0);

  useEffect(() => {
    const socket = io("http://localhost:8000", {
      transports: ["websocket", "polling"],
    });

    socket.on("connect", () => {
      console.log("✅ WebSocket Connected");
    });

    socket.on("drone_update", (data) => {
      console.log("📡 Live Drone Update: ", data);
      setDroneData(data);

      // Calculate average velocity
      const avgVel =
        data.length > 0
          ? (data.reduce((sum, drone) => sum + drone.velocity, 0) / data.length).toFixed(2)
          : 0;
      setAvgVelocity(avgVel);
    });

    socket.on("disconnect", () => {
      console.log("❌ WebSocket Disconnected");
    });

    return () => {
      socket.disconnect();
    };
  }, []);

  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h1 style={{ fontSize: "28px", fontWeight: "bold", marginBottom: "5px" }}>
        🚀 Illegal Drone Traffic Tracking
      </h1>
      <p style={{ fontSize: "16px", color: "#555", marginBottom: "10px" }}>
        Monitoring real-time drone activity & alerts 🚁
      </p>

      <MapContainer center={[37.7749, -122.4194]} zoom={3} style={{ height: "500px", width: "90%", margin: "auto" }}>
        <TileLayer url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png" />

        {droneData.map((drone, index) => (
          <Marker
            key={index}
            position={[drone.latitude, drone.longitude]}
            icon={L.icon({
              iconUrl: drone.velocity > 50 ? redMarker : greenMarker,
              iconSize: [32, 32], 
              iconAnchor: [16, 32], 
              popupAnchor: [0, -32],
            })}
          >
            <Popup>
              <strong>📡 Callsign: </strong>{drone.callsign}<br />
              <strong>🌍 Country: </strong>{drone.country}<br />
              <strong>📍 Latitude: </strong>{drone.latitude.toFixed(2)}<br />
              <strong>📍 Longitude: </strong>{drone.longitude.toFixed(2)}<br />
              <strong>🛫 Altitude: </strong>{drone.altitude.toFixed(2)} meters<br />
              <strong>⚡ Velocity: </strong>{drone.velocity.toFixed(2)} km/h
            </Popup>
          </Marker>
        ))}
      </MapContainer>

      {/* Live Drone Updates */}
      <div style={{ marginTop: "20px", padding: "10px", background: "#f8f9fa", borderRadius: "10px", width: "80%", margin: "20px auto" }}>
        <h2 style={{ fontSize: "20px", fontWeight: "bold", marginBottom: "5px", textAlign: "center" }}>
          📊 Live Drone Updates
        </h2>
        <p style={{ fontSize: "16px", fontWeight: "bold", color: "#ff5733", textAlign: "center" }}>
          ⚡ Avg Velocity: {avgVelocity} km/h
        </p>

        <ul style={{ listStyleType: "none", padding: "0", textAlign: "left" }}>
          {droneData.map((drone, index) => (
            <li key={index} style={{ marginBottom: "10px", fontSize: "14px", lineHeight: "1.5" }}>
              <span style={{ fontSize: "18px" }}>
                {drone.velocity > 50 ? "🚨" : "✅"}{" "}
              </span>
              <strong>{drone.callsign} ({drone.country})</strong> - 
              Lat: {drone.latitude.toFixed(2)}, Lon: {drone.longitude.toFixed(2)}, 
              Alt: {drone.altitude.toFixed(2)} meters, Vel: {drone.velocity.toFixed(2)} km/h
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
};

export default DroneMap;
